import React from 'react';

var map = L.map('map').fitWorld();

function Map() {
    return L.tileLayer('https://tile.openstreetmap.org/{z}/{x}/{y}.png', {
    maxZoom: 19,
    attribution: '© OpenStreetMap'
}).addTo(map);
}

export default Map
